  /* Main Rulez */
  error_reporting(0);
  @set_time_limit(ini_get('0'));

  /* Require Files */  
  require_once '../../includes/SMTP.php';
  require_once '../../includes/PHPMailer.php';

  if($_SERVER['REQUEST_METHOD'] == 'POST'):

    $server   = explode(':', $_POST['smtp']);

    $email    = $_POST['email'];

    $mail = new PHPMailer;
    $mail->IsSMTP();
    $mail->SMTPAuth = true;
    $mail->Host = $server[0];
    $mail->Port = $server[1];
    $mail->Username = $server[3];
    $mail->Password = $server[4];
    $mail->SMTPSecure = (in_array(strtolower($server[2]), array('ssl', 'tls'))) ? strtolower($server[2]) : '';
    $mail->Subject = uniqid();
    $mail->setFrom((isset($server[5])) ? $server[5] : $server[3], uniqid());
    $mail->AddAddress($email);
    $mail->msgHTML(uniqid());
    if(!$mail->Send()):

      $response = 'Error';

    else:

      $response = $_POST['smtp'];

    endif;

    exit($response);

  endif;

